function MessageOptions({ options, onSelect }) {
    return (
      <div>
        <h2>Select a message:</h2>
        {options.map((option) => (
          <button key={option} onClick={() => onSelect(option)}>
            {option}
          </button>
        ))}
      </div>
    );
}

export default MessageOptions;
